import TableItem from "./cartComponents/TableItem";
import InfoPanel from "./cartComponents/InfoPanel";
import { Layout, Sider, Content } from "antd";

const Cart = () => {
  return (
    <div>
      <h3>Giỏ hàng</h3>
      <Layout>
        <Content>
          <TableItem />
        </Content>
        <Sider>Sider</Sider>
      </Layout>

      <InfoPanel />
    </div>
  );
};

export default Cart;
